import React from 'react'
import PieChart from './PieChart'


export default function PieChartList({charts}) {
    if(charts.length === 0){
        return (
			<div className='empty-search'>
				<h3>
					unfortunately no pie chart left
				</h3>
			</div>
		    );
    }
    return (
			<>
					{charts.map(item => {
						return <PieChart key={item.id} ems={item} />;
                    })}
			</>
		);
}
